### 示例：如何提取指纹

1. **jQuery 版本检测**：
   - 在网页的 JavaScript 文件中查找类似 `jQuery.fn.jquery : "3.6.0"` 的字符串。
   - 正则表达式：`\\bjQuery\\.fn\\.jquery\\s*:\\s*\"([\\d.]+)\"`

2. **Bootstrap 版本检测**：
   - 在网页的 CSS 文件中查找类似 `bootstrap.min.css?v=5.1.3` 的字符串。
   - 正则表达式：`bootstrap\\.min\\.css.*?v=([\\d.]+)`

3. **React 版本检测**：
   - 在网页的 JavaScript 文件中查找类似 `React version: 17.0.2` 的字符串。
   - 正则表达式：`React version:\\s*([\\d.]+)`

