### 示例：识别 jQuery 和其他常见库

```json
[
    {
        "name": "jQuery",
        "authors": [
            "John Resig",
            "The jQuery Foundation <team@jquery.org>"
        ],
        "version": "3.6.0",
        "description": "jQuery 是一个快速、小巧且功能丰富的库。",
        "website": "https://jquery.com/",
        "matches": [
            {
                "version": {
                    "regex": "<script.*?src=[\"'].*?jquery(?:-ui)?(?:\\.slim)?(?:\\.min)?\\.js\\?(?:v=|ver=)([\\d.]+)",
                    "extraction": "$1"
                }
            },
            {
                "version": {
                    "regex": "<script.*?src=[\"'].*?jquery(?:-ui)?(?:\\.slim)?(?:\\.min)?\\.js.*?>",
                    "extraction": "jQuery.fn.jquery"
                }
            }
        ]
    },
    {
        "name": "Bootstrap",
        "authors": [
            "Twitter Inc.",
            "Mark Otto <markdotto@gmail.com>",
            "Jacob Thornton <jacob Thornton@gmail.com>"
        ],
        "version": "5.1.3",
        "description": "Bootstrap 是一个用于快速开发 Web 应用程序和网站的前端框架。",
        "website": "https://getbootstrap.com/",
        "matches": [
            {
                "version": {
                    "regex": "<link.*?href=[\"'].*?bootstrap\\.css\\?(?:v=|ver=)([\\d.]+)",
                    "extraction": "$1"
                }
            },
            {
                "version": {
                    "regex": "<link.*?href=[\"'].*?bootstrap\\.css.*?>",
                    "extraction": "Bootstrap.VERSION"
                }
            }
        ]
    },
    {
        "name": "React",
        "authors": [
            "Facebook, Inc.",
            "Various Contributors"
        ],
        "version": "17.0.2",
        "description": "React 是一个用于构建用户界面的 JavaScript 库。",
        "website": "https://reactjs.org/",
        "matches": [
            {
                "version": {
                    "regex": "<script.*?src=[\"'].*?react(?:\\.production)?(?:\\.min)?\\.js\\?(?:v=|ver=)([\\d.]+)",
                    "extraction": "$1"
                }
            },
            {
                "version": {
                    "regex": "<script.*?src=[\"'].*?react(?:\\.production)?(?:\\.min)?\\.js.*?>",
                    "extraction": "React.version"
                }
            }
        ]
    }
]
```

### 分析步骤：
1. **HTML 源代码检查**：查看 `<script>` 和 `<link>` 标签，寻找特定库的引入。
2. **正则表达式匹配**：使用正则表达式从 HTML 或 JavaScript 文件中提取版本号。
3. **JavaScript 执行环境**：在浏览器控制台执行某些全局变量（如 `jQuery.fn.jquery`）以确定版本。

